function:
REGISTRA O VALOR DA VPD COM O IMPOSTO, DE COMPETENCIA DA UNIAO, SOBRE A RENDA E PROVENTOS DE QUALQUER NATUREZA TEM COMO FATO GERADOR A AQUISICAO DA DISPONIBILIDADE ECONOMICA OU JURIDICA:

       I  DE RENDA, ASSIM ENTENDIDO O PRODUTO DO CAPITAL, DO TRABALHO OU DA COMBINACAO DE AMBOS;

        II  DE PROVENTOS DE QUALQUER NATUREZA, ASSIM ENTENDIDOS OS ACRESCIMOS PATRIMONIAIS NÃO COMPREENDIDOS NO ITEM ANTERIOR.

REGISTRA O VALOR DO IMPOSTO, DE COMPETENCIA DA UNIAO, SOBRE PRODUTOS INDUSTRIALIZADOS TEM COMO FATO GERADOR:

        I  O SEU DESEMBARACO ADUANEIRO, QUANDO DE PROCEDENCIA ESTRANGEIRA;

        II  A SUA SAIDA DOS ESTABELECIMENTOS A QUE SE REFERE O PARAGRAFO UNICO DO ARTIGO 51 DO CTN;

        III  A SUA ARREMATACAO, QUANDO APREENDIDO OU ABANDONADO E LEVADO A LEILAO.
PARA OS EFEITOS DESTE IMPOSTO, CONSIDERA SE INDUSTRIALIZADO O PRODUTO QUE TENHA SIDO SUBMETIDO A QUALQUER OPERACAO QUE LHE MODIFIQUE A NATUREZA OU A FINALIDADE, OU O APERFEICOE PARA O CONSUMO.

REGISTRA O VALOR DA VPD COM O IMPOSTO, DE COMPETENCIA DA UNIAO, SOBRE OPERAÇÕES DE CRÉDITO, CAMBIO E SEGURO, E SOBRE OPERAÇÕES RELATIVAS A TÍTULOS E VALORES MOBILIÁRIOS TEM COMO FATO GERADOR:

        I - QUANTO AS OPERAÇÕES DE CRÉDITO, A SUA EFETIVACAO PELA ENTREGA TOTAL OU PARCIAL DO MONTANTE OU DO VALOR QUE CONSTITUA O OBJETO DA OBRIGACAO, OU SUA COLOCACAO A DISPOSICAO DO INTERESSADO;

        II - QUANTO AS OPERAÇÕES DE CAMBIO, A SUA EFETIVACAO PELA ENTREGA DE MOEDA NACIONAL OU ESTRANGEIRA, OU DE DOCUMENTO QUE A REPRESENTE, OU SUA COLOCACAO A DISPOSICAO DO INTERESSADO EM MONTANTE EQUIVALENTE A MOEDA ESTRANGEIRA OU NACIONAL ENTREGUE OU POSTA A DISPOSICAO POR ESTE;

        III - QUANTO AS OPERAÇÕES DE SEGURO, A SUA EFETIVACAO PELA EMISSAO DA APOLICE OU DO DOCUMENTO EQUIVALENTE, OU RECEBIMENTO DO PREMIO, NA FORMA DA LEI APLICAVEL;

        IV - QUANTO AS OPERAÇÕES RELATIVAS A TÍTULOS E VALORES MOBILIÁRIOS, A EMISSAO, TRANSMISSAO, PAGAMENTO OU RESGATE DESTES, NA FORMA DA LEI APLICAVEL.

COMPREENDE O VALOR DA VPA COM O IMPOSTO, DE COMPETENCIA DA UNIAO, SOBRE A RENDA E PROVENTOS DE QUALQUER NATUREZA. TEM COMO FATO GERADOR A AQUISICAO DA DISPONIBILIDADE ECONOMICA OU JURIDICA:

       I - DE RENDA, ASSIM ENTENDIDO O PRODUTO DO CAPITAL, DO TRABALHO OU DA COMBINACAO DE AMBOS;

        II - DE PROVENTOS DE QUALQUER NATUREZA, ASSIM ENTENDIDOS OS ACRESCIMOS PATRIMONIAIS NÃO COMPREENDIDOS NO ITEM ANTERIOR.
